import React, { useState } from "react";
import {
  TextField,
  Button,
  Select,
  MenuItem,
  InputLabel,
  FormControl,
  FormLabel,
  RadioGroup,
  FormControlLabel,
  Radio
} from "@mui/material";
import Textarea from "../components/TextArea";
import { useLocation, useNavigate } from "react-router-dom";

function Order() {
  const navigate = useNavigate();
  const location = useLocation();
  const [form, setForm] = useState({
    firstName: "",
    lastName: "",
    phoneNumber: "",
    email: "",
    zipcode: 0,
    pickUpDate: Date,
    pickupTime: Date,
    numberOfServings: 0,
    orderType: "",
    flavor: "",
    orderDetails: "",
    refPictures: "",
  });
  const orderTypes = [
    {
      id: 1,
      value: "Cupcakes",
    },
    {
      id: 2,
      value: "Cakes",
    },
    {
      id: 3,
      value: "Cakes & Cupcakes",
    },
  ];
  const flavors = [
    {
      id: 1,
      value: "Strawberry",
    },
    {
      id: 2,
      value: "Vanilla",
    },
    {
      id: 3,
      value: "Chocolate",
    },
    {
      id: 4,
      value: "Red Velvet",
    },
    {
      id: 5,
      value: "Carrot",
    },
    {
      id: 6,
      value: "Other (please list below in details)",
    },
  ];
  
  return (
    <div className="py-7">
      <div className="bg-white w-2/4 h-[900px] rounded-md flex flex-row justify-around mr-auto ml-auto pl-12">
        <form
          style={{
            display: "flex",
            flexDirection: "column",
            maxWidth: "450px",
            margin: "auto",
            height: "100%",
            gap: "3rem",
          }}
        >
          <h1 className="text-2xl font-semibold py-3">Let's Get You Some Cake!</h1>
          <TextField
            label="First Name"
            type="text"
            variant="outlined"
            name="firstName"
            value={form.firstName}
          />
          <TextField
            label="Last Name"
            type="text"
            variant="outlined"
            name="lastName"
            value={form.lastName}
          />
          <TextField
            label="Pickup Date"
            type="date"
            variant="outlined"
            name="date"
            value={form.pickUpDate}
          />
          <TextField
            label="Pickup Time"
            type="time"
            variant="outlined"
            name="time"
            value={form.pickupTime}
          />
          <TextField
            label="Number of Servings"
            type="text"
            variant="outlined"
            name="servings"
            value={form.numberOfServings}
          />
          <FormControl fullWidth>
            <InputLabel>Order Type</InputLabel>
            <Select sx={{ width: "60%" }}>
              {orderTypes.map((item) => (
                <MenuItem key={item.id}>{item.value}</MenuItem>
              ))}
            </Select>
          </FormControl>
          <FormControl>
            <FormLabel>Flavor</FormLabel>
            <RadioGroup row>
             {flavors.map((item)=> (<FormControlLabel value={item.value} key={item.id} control={<Radio />} label={item.value} />))}
            </RadioGroup>
          </FormControl>
          <FormControl>
            <FormLabel>Order Details</FormLabel>
            <Textarea minRows={3} placeholder="Allergies, Cake Flavor, and etc."/>
          </FormControl>
          <FormControl>
            <FormLabel>Reference Photos</FormLabel>
            <Textarea minRows={3} placeholder="links" label="Reference Photos"/>
          </FormControl>
          <div className="py-2">
            <Button variant="contained" sx={{ backgroundColor: "black" }}>
              Submit Order
            </Button>
          </div>
        </form>
      </div>
    </div>
  );
}

export default Order;
